import image from './components/images/Path.png';
import map from './components/images/locattion.png';
import Data from './Data';



function App() {
  const dataset = Data.map((item,id) =>{
    return(


      <Journal key={index} img={map}
      details={item.id}


      />
    )





  })
  return (
    <div className="App">
     <img src={image} className="banner-image" alt="" />
    <Navbar imge={image}


    />
    <Navbar/>
     {dataset}
    </div>
  );
}

export default App;
